// TripData.js

import React from 'react';

const Productdata = ({ props}) => {
  return (
    <div className="t-card">
      <div className="t-image">
        <img src={props.image} alt="image" />
      </div>
      <h4>{props.heading}</h4>
      <p>{props.text}</p>
      {/* <button className="add-to-cart-button">Add to Cart</button> */}
    </div>
  );
}

export default Productdata;
